import React, { Component } from "react";

export default class UsersList extends Component {
  render() {
    return (

        <div className="table">
          <ul className="heading">
            <li>First Name</li>
            <li>First Name</li>
            <li>First Name</li>
            <li>First Name</li>
          </ul>
          {this.props.Userdata.map(data=>(<ul className="userdata">
            <li>{data[0]}</li>
            <li>First Name</li>
            <li>First Name</li>
            <li>First Name</li>
          </ul>))}


        </div>

    );
  }
}
